INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(1, 'Pathology', 'Health IQ basically aims at improving lifes of others. In terms of pathology, it is a medical specialty that determines the cause and nature of diseases by examining and testing body tissues (from biopsies and pap smears, for example) and bodily fluids (from samples including blood and urine). The results from these pathology tests help Doctors diagnose and treat patients correctly. Basically, an integral part of clinical diagnosis', '../../assets/img/services images/pathology .jpg', 'page3 url (if any)', '2016-03-22 09:27:52', '2019-08-03 12:17:18', 0, 0, 'Biochemistry,Clinical Pathology,Cytopathology,Haematology, Immunology, Molecular Biology, Molecular Genetics, Serology', NULL);
INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(2, 'Cardiology', 'Cardiology is a medical specialty and a branch of internal medicine concerned with disorders of the heart. It deals with the diagnosis and treatment of such conditions as congenital heart defects, coronary artery disease, electrophysiology, heart failure and heart disease. Subspecialties of the cardiology field include cardiac electrophysiology, echocardiography, interventional cardiology and nuclear cardiology', '../../assets/img/services images/cardiology.jpg', 'page3 url (if any)', '2019-07-29 09:27:52', '2019-08-03 12:16:24', 0, 0, 'ECG, Holter monitoring, BP monitoring', NULL);
INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(3, 'Spirometry', 'Spirometry (spy-ROM-uh-tree) is a common office test used to assess how well your lungs work by measuring how much air you inhale, how much you exhale and how quickly you exhale.Spirometry is used to diagnose asthma, chronic obstructive pulmonary disease (COPD) and other conditions that affect breathing. Spirometry may also be used periodically to monitor your lung condition and check whether a treatment for a chronic lung condition is helping you breathe better.', '../../assets/img/services images/spirometry.jpg', 'page3 url (if any)', '2019-07-29 09:27:52', NULL, 0, 0, NULL, NULL);
INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(4, 'Neurology', 'Neurology is a branch of medicine dealing with disorders of the nervous system. Neurology deals with the diagnosis and treatment of all categories of conditions and disease involving the central and peripheral nervous systems, including their coverings, blood vessels, and all effector tissue, such as muscle.', '../../assets/img/services images/Neurology.jpg', NULL, '2019-08-08 09:27:52', NULL, 0, 0, 'NCV Study,  EMG Study , EEG ,BLINK REFLEX    ,VEP Study ,BAER Study  ,SSEP Study  ', NULL);
INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(5, 'GynaCare', 'Gynaecare clinic offers a comprehensive range of treatments with complete scientific solutions for infertility and sexual dysfunctions. Our dedicated team of doctors personally interact with the patients , answer their queries and decide on the treatment accordingly. We offer the best services in fertility and reproductive medicine. Some of the services offered at our clinic are:', '../../assets/img/services images/gynae-clinic.jpg', NULL, '2019-08-08 09:27:52', NULL, 0, 0, 'Pre & post-natal check up,Laproscopic surgeries, Hysterectomy,Measures for Family Planning, Abnormal bleeding problems, Treatment for Hormonal Imbalance, Blood Tests, IVF or In Vitro Fertilization, Infertility work up, IUI or Intrauterine Insemination,\r Safe medical termination of pregnancy (abortion).\r', NULL);
INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(6, 'Child Care Clinic', 'Childcare clinic offers a comprehensive range of treatments with complete solutions for Child. Our experienced team of Paediatricians caters to the Medical Needs of Newborns, Toddlers, Teenagers and Adolescents., answer their queries and decide on the treatment accordingly. We offer the best services in Paedtrics. Some of the services offered at our clinic are', '../../assets/img/services images/child-care-clinic.jpg', NULL, '2019-08-08 09:27:52', NULL, 0, 0, 'Neonatology\r,Paedtric Intensivist', NULL);
INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(7, 'Diabetes Care Clinic', 'Diabetes is a hassle-some disease. At Health IQ, we take the stress out of diabetes. We provide everything a diabetic might need, under one roof. Right from diagnosis to speaking to a dietician, educator, diabetologist. As a patient, you dont have to keep going from pillar to post. We help patients manage Type 1, 2, gestational or prediabetes. Our evaluations, physical exams and treatments are geared to detect and prevent complications brought on by the disease. Our medical team can help you create routines for nutrition and exercise to prevent diabetes if you are prediabetes. For some type 2 patients, we may be able to control diabetes without medication through weight loss, diet and exercise. Our goal is to provide the best possible solution for your particular diagnosis. There are many ways to treat diabetes. Our doctors gives you options and works with you to design a plan that fits your lifestyle so you can successfully live with diabetes. Along with diet, exercise, oral medications, insulin and non-insulin injections, we also have expertise in insulin pump and continuous glucose monitoring.', '../../assets/img/services images/diabetes-.jpg', NULL, '2019-08-08 09:27:52', NULL, 0, 0, NULL, NULL);
INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(8, 'Endrocrinology', 'The department of endocrinology at  Health IQ offers the best treatment modalities available for endocrine disorders to provide accurate and comprehensive care for its patients suffering from various endocrine diseases.\r', '../../assets/img/services images/endrocrinology.jpg', NULL, '2019-08-08 09:27:52', NULL, 0, 0, NULL, NULL);
INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(9, 'Ortho Clinic', 'The department of orthopaedic at Health IQ offers the best treatment modalities available for ortho ailments to provide accurate and comprehensive care for its patients suffering from various ortho problems. In addition, efficient occupational therapists, physiotherapists and pain management experts work towards the quick rehabilitation of the patient leading to a better quality of life', '../../assets/img/services images/ortho-clinic.jpg', NULL, '2019-08-08 09:27:52', NULL, 0, 0, NULL, NULL);
INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(10, 'Physiotherapy', 'Physiotherapy is a health science that aims in rehabilitation and enhance individuals with movement chaos by utilizing evidence-based, natural process like motivation, exercise, education, advocacy and adapted tools. Physiotherapists study subjects like neuroscience,physiology and anatomy for developing attitudes and skills that are very much required for health prevention, education, rehabilitation and treatment of the patients with disabilities and physical ailments.It is sad to say that there are still many educated people in India who think that physiotherapy is only related to a few exercises. Physiotherapy is a science in itself. One might be suffering from cardiopulmonary ,orthopaedic, paediatric, neurology, sports injury, congenital abnormality, to name a few, where physical management becomes as a essential part of the rehabilitation process and some times is the only process. Why physiotherapy at Leela HealthCare? At Leela HealthCare our clinic run by experienced team of doctors and paramedics.  We have all type modern Electrotherapy equipments,exercise Theraphy,Manual Theraphy,here patient can get Acupuncture Treatment facility also apart with these. We basically try to alleviate the pain through various modern techniques or tools that can be used by the experience team of doctors and paramedics.\r \"', '../../assets/img/services images/physiotherapy.jpg', NULL, '2019-08-08 09:27:52', NULL, 0, 0, NULL, NULL);
INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(11, 'Pain Clinic', 'We provide pain management services for diagnosis and treatment for painful conditions.We treat back pain, knee pain, headache, neck pain and cancer pain etc.... due to slipped disc, migraine, Cluster Headache, trigeminal neuralgia, arthritis, spondylitis, cancer etc. We use most advanced interventional pain management methods...like radio-frequency ablation, spinal cord stimulation, Percutaneous Discectomy, vertebroplasty, Epidural steroid injections, Epiduroscopy, Ozone Necleolysis, Platelet Rich Plasma (PRP) Therapy etc.', '../../assets/img/services images/pain-clinic.jpg', NULL, '2019-08-08 09:27:52', NULL, 0, 0, 'IFT,Laser Therapy,Tens,Acupuncture/Dry Needling,Electro acupuncture,Ultrasonic therapy,Diapulse /SWD,Electro stimulators,Neuromuscular stimulations,Electronic tractions,Manual Therapy/Manupulataion,Taping Techniques\r \"', NULL);
INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(12, 'Sports Medicine', 'Sports Medicine is an integral part of modern medicine. Sports Medicine practitioners deal with human fitness and conditioning related to performance, different types of injuries including sports injuries, rehabilitation, pain and weaknesses arising out of different kinds of injuries and diseases The GOAL of Sports Medicine is to prevent injuries, to improve bodily functions and movements and to treat pain in the shortest possible time and with minimum use of medicines. Sports Medicine Therapy requires specific infrastructure including modern Physiotherapy and modern gadgets and also a team of qualified and dedicated experts from different branches of sports sciences.  ood nutrition is an important part of leading a healthy lifestyle. Health issues such as diabetes, hypertension or atherosclerosis could be a result of poor nutrition. The Nutrition and Dietetics Centre at Apollo  Clinic strives to establish and encourage nutritional standards and practices as an integral part of the health care service provided.', '../../assets/img/services images/Sports-Medicine.jpg', NULL, '2019-08-08 09:27:52', NULL, 0, 0, NULL, NULL);
INSERT INTO `HealthServiceMaster` (`ID`, `Name`, `Description`, `ImageUrl`, `PageUrl`, `CreatedDate`, `UpdatedDate`, `IsDeleted`, `Type`, `ServicesIncluded`, `CompanyID`) VALUES(13, 'Nutrition / Dietician', 'Dietetics is about healthy eating practices which act as a preventive and curative means and pave the foundation for a healthier life. At  Health IQ, we regularly counsel our patients about a nutritious, balanced diet that consists of carbohydrates, fats, proteins, minerals, vitamins and electrolytes for their general well-being. Good nutrition is essential for normal organ development and function, normal reproduction, growth and maintenance of muscles and tissue, optimum activity and working efficiency, building resistance to infection and in repairing body damage or injury. The Nutrition and Dietetics team at Leela HealthCare aims to improve the clinical, biochemical, cellular and psychological status of individuals experiencing complications or side effects of various treatments by providing adequate nutrition and related information.', '../../assets/img/services images/nutrition-dietician.jpg', NULL, '2019-08-08 09:27:52', NULL, 0, 0, NULL, NULL);

